import { Link } from "react-router-dom";
import { getHistory } from "../services/allAPI";
import { useEffect, useState } from "react";


function WatchHistory(){

  const [history,setHistory]=useState([])
  const getAllHistory= async ()=>{
    const response= await getHistory();
    console.log("===history===");
    console.log(response);
    setHistory(response)
    
  }
  useEffect(()=>{
    getAllHistory();
    },[])


    return(
      <>
      <div className=" container d-flex justify-content-between mt-5 mb-5">
        <h3 style={{fontFamily:"-moz-initial"}}>Watch History</h3>
        <Link style={{color:"white",fontFamily:"-moz-initial",textDecoration:"none"}} to={'/Home'}>  <i class="fa-solid fa-arrow-left"><br />Home</i></Link>
      </div>
      <table className="table mt-5 mb-5 container">
        <thead>
            <tr style={{fontFamily:"-moz-initial"}}>
                <th>#</th>
                <th>Caption</th>
                <th>URL</th>
                <th>Time</th>
            </tr>
        </thead>
        <tbody>

            <tr style={{fontFamily:"-moz-initial"}}>
                <td>1</td>
                <td>Animal</td>
                <td>lihttps://www.youtube.com/watch</td>
                <td>07/12/2023</td>
            </tr>
        </tbody>
      </table>
      </>
    )
}
export default WatchHistory;
